import styles from "./NavBar.module.scss";
import { Link } from "react-router-dom";

export const NavBar = () => {
  return (
    <div className={styles.navbar}>
      <button className={styles.brand__name}>
        C<span className={styles.brand__name_tiny}>ara</span>T
        <span className={styles.brand__name_tiny}>ran</span>
      </button>
      <Link to="/ProjectsPage" className={styles.navbar_links}>
        PROJECTS
      </Link>
      <Link to="/AboutMePage" className={styles.navbar_links}>
        ABOUT
      </Link>
      {/* <Link to ="/AboutMePage" className={styles.navbar_links}>SKILLS</Link> */}
      <div to="/AboutMePage" className={styles.navbar_links}>
        SKILLS
      </div>
      <Link to="/AboutMePage" className={styles.navbar_links}>
        CONTACT
      </Link>
      <a
        className={styles.navbar_links}
        href="https://drive.google.com/file/d/1uiWEA-P7Ae5QbhsN1tWPb3-oq4yBOayz/view?usp=sharing"
      >
        CV
      </a>
    </div>
  );
};
